import PhoneDrop from "./phoneDrop";

function DropDown({turn, hidePhone, hidePhoneSpace, hideSoc, socSpace, atDrop}){

    return(
        <div id={`dropDown${turn}`}>
            {true ? <PhoneDrop /> : console.log("blam")}
            <div id={hideSoc}>
                <h1 id="socialTitle">Socials</h1>
                    <a rel="noreferrer" href="https://www.linkedin.com/in/robert-de-luna-9b9691165/" target="_blank">
                        <h3 id={atDrop}>Linkedin</h3>
                    </a>
                    <div id={socSpace}></div>
                    <a rel="noreferrer" href="https://github.com/Hushtonebob" target="_blank">
                        <h3 id={atDrop}>GitHub</h3>
                    </a>
                    <div id={socSpace}></div>
                    <a rel="noreferrer" href="https://www.instagram.com/hushtonebob/" target="_blank">
                        <h3 id={atDrop}>Instagram</h3>
                    </a>     
            </div>           
        </div>
    )

//end of component
};

export default DropDown;
